      <ul>
        <li>All</li>
        <li>Pending</li>
        <li>Completed</li>
      </ul>
    </div>
  );
};

const mapDispatchToProps = dispatch => {
  return {};
};
export default connect(null, mapDispatchToProps)(Tabs);
